  "\"J\u00f3venes Consejo Estudiantil Nacional he\u2019i hiku\u00e1i oman\u00f3ha
  educaci\u00f3n paraguaya ary 2020 ha omo\u00ee pete\u00ee corona de flores p\u00e9va
  Ministerio de Educaci\u00f3n y Ciencias (MEC)-pe. Oguerovia hiku\u00e1i omo\u00eevo
  hiku\u00e1i pete\u00ee fracaso sistema implementado ha\u2019\u00e9va clases virtuales
  ojeipys\u00f3va.\\n10 de octubre de 2020 \u2013 20:53\\nNicol\u00e1s Maldonado,
  presidente Consejo Estudiantil, he\u2019i educaci\u00f3n nacional omano ko ar\u00fdpe
  ha temimbo\u2019e oimeh\u00e1pe plan de educaci\u00f3n p\u00e9va \u201cojeharu ko\u2019\u00e3
  sentido\u201d. Ombojoapy temimbo\u2019e ohasa as\u00fdva estr\u00e9s o\u00f1eikotev\u00eava
  o\u00f1emohend\u00e1vo clases virtuales. He\u2019i jey ko\u2019\u00e3 temimbo\u2019e
  ndorek\u00f3iva posibilidad econ\u00f3mica ohupyty hagu\u00e3 internet h\u00f3ga
  guive. \u201cRoguero corona umi temimbo\u2019e paraguayo r\u00e9rape ha rojer\u00fare
  ministerio ani oho clase presencial ko ar\u00fdpe\u201d, he\u2019i jey. OMoa\u00f1ete
  ko\u2019\u00e3va ndorek\u00f3iva sentido ni ome\u2019\u00eavo mbo\u2019ehao kot\u00fdpe
  ni orrendi hagu\u00e3, p\u00e9va sistema implementado noaprend\u00e9i mba\u2019evete.\\nMaldonado
  he\u2019i gremio mba\u2019apoh\u00e1pe MEC guive, pero ndoval\u00e9i mba\u2019ever\u00e3.
  \u201cMinisterio nopen\u00e1i umi tekotev\u00ea ha orek\u00f3va temimbo\u2019\u00e9pe
  oiko\u2019\u00f5va ni sector docente-pe\u201d, omoa\u00f1ete. Ministro de Educaci\u00f3n,
  Eduardo Petta, omom\u00fdi oh\u00f3vo consenso, pero ndoguerohor\u00fdiva hiku\u00e1i.
  Presidenta Federaci\u00f3n de padres Fedapy, Francisca Monges, he\u2019i ABC-pe
  ko arapok\u00f5ind\u00fdpe ABC pete\u00ee ministro cerrado, ego\u00edsta, omanipul\u00e1va
  situaci\u00f3n.\\nCamila Gim\u00e9nez, Federaci\u00f3n de Estudiantes Fenaes, oguerovia
